  useEffect(() => {
    fetch("https://restcountries.com/v3.1/all")
      .then((response) => response.json())
      .then((json) => setPosts(json));
  }, []);

  posts.forEach((el) => {
    console.log(posts[2].name.common);
  });

  return <div></div>;
}
export default Container;
